import React, { Component } from "react";
import Accordion from "react-bootstrap/Accordion";
import Card from "react-bootstrap/Card";
import Button from "react-bootstrap/Button";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import { H2Style, CardBodyStyle1, SectionStyle1 } from "../Helpers/stlyes";

export default class Members extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <Card style={SectionStyle1}>
        <Card.Header>
          <Accordion.Toggle as={Button} variant="link" eventKey="2">
            <h2 style={H2Style}>Members</h2>
          </Accordion.Toggle>
        </Card.Header>
        <Accordion.Collapse eventKey="2">
          <Card.Body style={CardBodyStyle1}>
            <Container>
              <Row>
                <Col xs={6} md={4}>
                  <Image src="../../assets/images/brad_photo.jpg" rounded />
                </Col>
                <Col xs={6} md={4}>
                  <Image src="../../assets/images/sam_photo.jpeg" roundedCircle />
                </Col>
                <Col xs={6} md={4}>
                  <Image src="../../assets/images/enoch_photo.jpg" thumbnail />
                </Col>
              </Row>
            </Container>
          </Card.Body>
        </Accordion.Collapse>
      </Card>
    );
  }
}
